import React, {Component} from 'react';
import  bg from './drawable/bg.jpg'
import './css/carosal.css'

class Add extends Component {
    render() {
        return (
            <div className="add">
                <img src={bg} alt=""/>
            </div>
        );
    }
}

export default Add;
